import {GET_PERSON} from '../actions/action-type';      

const initialState = {
    person: [{
    }]
}

function rootReducer (state = initialState, action) {
    return state; 
    
    if (action.type === GET_PERSON) {
        return {person: state.person.concat({person: action.payload.results})}
        return state; 
    }
}

export default rootReducer;
